import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Axios from 'axios';

class Configure extends Component {
  constructor(props) {
    super(props);
    this.state = {
      columns: [{ "header": "Client", "name": "client" },
      { "header": "Worker", "name": "worker" },
      { "header": "Resource Manager", "name": "resourceManager" }],
      startDate: null,
      endDate: null
    }
    // this.handleOnChange = this.handleOnChange.bind(this);
    // this.handleAdd = this.handleAdd.bind(this);
    // this.handleUpdate = this.handleUpdate.bind(this);
    // this.handleDelete = this.handleDelete.bind(this);
    this.handleClose = this.handleClose.bind(this);
    // this.handleSubmitAdd = this.handleSubmitAdd.bind(this);
    // this.handleSubmitUpdate = this.handleSubmitUpdate.bind(this);
    // this.handleSubmitDelete = this.handleSubmitDelete.bind(this);
  }

  handleBillRate = (id) => {
      debugger
      Axios({ //when updating information
        url: 'http://localhost:9091/bill_rate/getByUI/' + id,
        method: "get",
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        debugger
        console.log(this.props);
        this.setState ({
            data : res.data,
            showBR : true,
            showPR: false,
            showRH: false,
            showCR: false
        })
      }).catch(err => {
        console.log(err);
      })
  }

  render() {
    console.log("props--------", this.props);
    console.log("line 314", this.state);
    return (
      <div>
        <table>
          <thead>
            <tr>
              {this.state.columns.map(col =>
                <th key={col.name}>{col.header}</th>
              )}
            </tr>
          </thead>
          <tbody>
            {this.props.rows.map(row =>
              <tr key={row.id} >
                {this.state.columns.map(col =>
                  <td key={col.name}>{row[col.name]}</td>
                )}

                <Button variant="primary" onClick={() => { this.handleBillRate(row.uniqueId) }} >Billing</Button>
                <Button variant="primary" onClick={() => { this.handlePayRate(row.uniqueId) }} >Pay</Button> 
                <Button variant="primary" onClick={() => { this.handleResourceHours(row.uniqueId) }} >Timesheet</Button>
                <Button variant="primary" onClick={() => { this.handleCommissionRates(row.uniqueId) }} >Commission</Button>  
              </tr>
            )}
          </tbody>
        </table>

        <Modal show={this.state.showBR} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Given Bill Rates</Modal.Title>
          </Modal.Header>
            <Modal.Body>

            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
            </Modal.Footer>
        </Modal>

        <Modal show={this.state.showUpdateBR} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Update Bill Rates</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitUpdate}>
            <Modal.Body>
              <br />
              <label For="id">ID</label>
              <br />
              <label For="id" >{this.state.id}</label>
              <br />
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.handleOnChange} value={this.state.name} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" onChange={this.handleOnChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>


        <Modal show={this.state.showDelete} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Are you sure you want to Delete?</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitDelete}>
            <Modal.Body>
              <label For="ID">Resource Manager ID:{this.state.id} </label>
              <input id="ID" type="text" onChange={this.handleOnChange} value={this.state.id} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                No
                </Button>
              <Button type="submit" variant="primary"> 
                Yes
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

       <Modal show={this.state.showAdd} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Add New Resource Manager</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitAdd}>
            <Modal.Body>
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.handleOnChange} value={this.state.name} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" class="form-control" onChange={this.handleOnChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" class="form-control" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form> 
        </Modal>

      </div>
    );
  }
}

export default Configure;
